import React from 'react';
import {BrowserRouter as Router,Route} from 'react-router-dom';
import Sapling from './components/sapling';

const App=()=>{
    return (
        <div>
        <Router>
            <Route  component={Sapling} path="/sapling"/>

        </Router>
        </div>

    )
};
export default App;
